         ? {_multiplier_64x8_io_out, 56'h0}
         : {8'h0,
            executor_stage == 3'h6
              ? {_multiplier_64x8_io_out, 48'h0}
              : {8'h0,
                 executor_stage == 3'h5
                   ? {_multiplier_64x8_io_out, 40'h0}
                   : {8'h0,
                      executor_stage == 3'h4
                        ? {_multiplier_64x8_io_out, 32'h0}
                        : {8'h0,
